// interface class for object with collision and bounding box
class BoundedHTMLElement {
    position = {
        x: 0,
        y: 0,
    };
    width = null;
    height = null;
    bottom = null;
    right = null;
    maxWidth = null;
    maxHeight = null;
    scrollbarWidth = null;
    dom = null;

    constructor () {
        this.updateScrollbarWidth();
    }

    /**
     * @param {{ x: number; y: number; }} val
     */
    setPosition = (val) => {
        this.setX(this.boundX(val.x));
        this.setY(this.boundY(val.y));
        this.dom.style.transform = `translate(${this.position.x}px, ${this.position.y}px)`;
    }
    setX = (val) => {
        this.position.x = val;
        this.right = val + this.width;
    }
    setY = (val) => {
        this.position.y = val;
        this.bottom = val + this.height;
    }
    updateScrollbarWidth = () => {
        // Add temporary box to wrapper
        let scrollbox = document.createElement('div');

        // Make box scrollable
        scrollbox.style.overflow = 'scroll';

        // Append box to document
        document.body.appendChild(scrollbox);

        // Measure inner width of box
        this.scrollbarWidth = (document.body.scrollHeight > document.body.clientHeight)? scrollbox.offsetWidth - scrollbox.clientWidth : 0;

        // Remove box
        document.body.removeChild(scrollbox);

        return;
    };
    updateMaxHeight = () => {
        this.maxHeight = window?.innerHeight - this.scrollbarWidth;
        return this.maxHeight;
    };
    updateMaxWidth = () => {
        this.maxWidth = window?.innerWidth - this.scrollbarWidth;
        return this.maxWidth;
    };
    boundX = (val) => {
        if (val < 0) {
            return 0;
        }
        this.updateMaxWidth();
        if (val + this.width > this.maxWidth) {
            return this.maxWidth - this.width;
        }
        return val;
    };
    boundY = (val) => {
        if (val < 0) {
            return 0;
        }
        this.updateMaxHeight();
        if (val + this.height > this.maxHeight) {
            return this.maxHeight - this.height;
        }
        return val;
    };
    onXBound = () => {
        this.updateMaxWidth();
        return this.position.x === 0 || this.right === this.maxWidth;
    }
    onYBound = () => {
        this.updateMaxHeight();
        return this.position.y === 0 || this.bottom === this.maxHeight;
    }
    onSkyBound = () => {
        return this.position.y === 0;
    }
    onGroundBound = () => {
        this.updateMaxHeight();
        return this.bottom === this.maxHeight;
    }

    /**
     * function to determine if shimeji should fall from sky
     * @returns {boolean} true if should fall, else false
     */
    shouldFall = () => {
        this.updateMaxHeight();
        this.updateMaxWidth();
        // not on left or right wall
        if ( !this.onXBound() ) {
            // not on ground
            return !this.onYBound();
        }
        return false;
    }

    /**
     * function to determine if any ELEMENT should fall in y-axis regardless of x coordinate, will return false when element hits ground or rect of another div
     * @returns {[boolean, HTMLElement]} [boolean true if should fall, visible element to collide or null if none]
     */
    shouldFallYCollide = (visibleElements=[]) => {
        this.updateMaxHeight();
        if ( !this.onYBound() ) {
            // not on ground
            for(let i=0; i<visibleElements.length; ++i) {
                let rect = visibleElements[i].getBoundingClientRect();
                if (rect.y < this.bottom || this.right < rect.x || this.position.x > rect.right)
                    continue;
                // return the first div element to be collided
                return [this.bottom < rect.y, visibleElements[i]];
            }
            return [true, null];
        }
        return [false, null];
    }

    /**
     * function to determine if any ELEMENT should fall in y-axis regardless of x coordinate
     * @returns {boolean} true if should fall else false
     */
    shouldFallY = () => {
        return !this.onGroundBound();
    }
};

// right click menu class
class ContextMenu {
    dom = null;
    #isToggled = false;
    #position = {
        x: 0,
        y: 0,
    };
    removeFn = null;
    duplicateFn = null;
    #parentId = null;

    handleRemove = (e) => {
        e.stopPropagation();
        this.hideMenu();
        let clone = this.dom.cloneNode(true);
        // remove all event listener on context menu and child buttons
        this.dom.parentNode.replaceChild(clone, this.dom);
        document.getElementById(this.removeBtn.getAttribute('id')).remove();
        document.getElementById(this.duplicateBtn.getAttribute('id')).remove();
        this.dom.remove();
        document.getElementById(this.dom.getAttribute('id')).remove();
        this.removeFn();
    }

    handleDuplicate = (e) => {
        e.stopPropagation();
        this.hideMenu();
        this.duplicateFn();
    }

    /**
     * @param {{ position: { x: number; y: number; }; toggled: boolean; }} val
     */
    setMenu = (val) => {
        this.dom.style.top =  `${0 + 2}px`;
        this.dom.style.left = `${0 + 2}px`;
        this.#isToggled = val.toggled;
        this.toggle();
    }

    toggle = () => {
        if (this.#isToggled) {
            this.showMenu();
            return;
        }
        this.hideMenu();
    }

    showMenu = () => {
        this.dom.style.visibility = 'visible';
        this.#isToggled = true;
    }
    hideMenu = () => {
        this.dom.style.visibility = 'hidden';
        this.#isToggled = false;
    }

    isVisible = () => {
        return this.#isToggled;
    }

    constructor (parentId, remove, duplicate) {
        this.#parentId = 'shimeji-' + parentId;
        this.removeFn = remove;
        this.duplicateFn = duplicate;
        this.dom = document.createElement('div');
        const eleId = 'shimeji-menu-' + parentId;
        this.dom.setAttribute('id', eleId);
        this.dom.style.visibility = 'hidden';
        this.dom.style.top =  `${this.#position.y + 2}px`;
        this.dom.style.left = `${this.#position.x + 2}px`;
        this.dom.classList.add('shimeji-menu');
        
        this.removeBtn = document.createElement('button');
        this.removeBtn.setAttribute('id', `shimeji-remove-btn-${parentId}`);
        this.removeBtn.classList.add('shimeji-menu-btn');
        this.removeBtn.innerHTML = '<span>Remove</span>';
        this.removeBtn.onclick = this.handleRemove;
        
        this.duplicateBtn = document.createElement('button');
        this.duplicateBtn.setAttribute('id', `shimeji-duplicate-btn-${parentId}`);
        this.duplicateBtn.classList.add('shimeji-menu-btn');
        this.duplicateBtn.innerHTML = '<span>Duplicate</span>';
        this.duplicateBtn.onclick = this.handleDuplicate;
        
        this.dom.appendChild(this.removeBtn);
        this.dom.appendChild(this.duplicateBtn);
        
        return this;
    }

};

// Shimeji frame container for each action
class ShimejiFrame {
    actionName = "";
    actionID = null;
    currFrame = 0;
    frameCount = 0;
    dom = null;
    id = null;
    frames = [];

    constructor (parentId, actionID) {
        this.dom = document.createElement('div');
        this.dom.classList.add('shimeji-frame-container');
        this.dom.style.visibility = 'hidden';

        this.actionID = actionID;
        this.actionName = Object.keys(ACTIONS)[actionID];
        this.id = `shimeji-${parentId}-${this.actionName}-container`;
        this.dom.setAttribute('id', this.id);

        // create each frame elements
        this.frameCount = ACTIONS_SOURCES[this.actionName].length;
        this.frames = Array(this.frameCount).fill(null);
        ACTIONS_SOURCES[this.actionName].forEach((frame, index) => {
            this.frames[index] = document.createElement('img');
            this.frames[index].setAttribute('src', frame);
            this.frames[index].setAttribute('alt', `shimeji-${parentId}-${this.actionName}-${index}`);
            this.frames[index].setAttribute('id', `shimeji-${parentId}-${this.actionName}-${index}`);
            this.frames[index].classList.add(`shimeji-frame`);
            this.frames[index].style.visibility = 'hidden';
            this.dom.appendChild(this.frames[index]);
        });

        return this;
    }

    activate = () => {
        this.dom.style.visibility = 'visible';
        this.restart();
    }
    
    deactivate = () => {
        this.dom.style.visibility = 'hidden';
        this.#hideFrame(this.currFrame);
        this.currFrame = 0;
    }

    #hideFrame = (index) => {
        this.frames[index].style.visibility = 'hidden';
    }
    #showFrame = (index) => {
        this.frames[index].style.visibility = 'visible';
    }

    // animate current action with next frame
    nextFrame = () => {
        this.#hideFrame(this.currFrame);
        // increment currFrame counter
        this.currFrame = (this.currFrame + 1) % this.frameCount;
        this.#showFrame(this.currFrame);
    }

    // restart animation from first frame
    restart = () => {
        this.#hideFrame(this.currFrame);
        this.currFrame = 0;
        this.#showFrame(0);
    }

    // align shimeji to face the correct direction
    align = (transform) => {
        this.dom.style.transform = transform;
    }

    remove = () => {
        this.frames.forEach((frame) => {
            frame.remove();
            document.getElementById(frame.getAttribute('id')).remove();
        });
        this.dom.remove();
        document.getElementById(this.dom.getAttribute('id')).remove();
    }
};

// Shimeji feeding food
class ShimejiFood extends BoundedHTMLElement {
    id = null;
    eaten = false;  // is food on the ground and ready to be eaten?
    height = 16;
    width = 16;
    notifyInterval = null;
    eatenByShimejiId = null;

    canEat = () => {
        return this.eaten;
    }

    /**
     * Consume this ShimejiFood by one and only Shimeji at first come first serve basis
     * @param {number} shimejiId ID of Shimeji that is eating this ShimejiFood
     * @returns {boolean} true if successfully eaten the ShimejiFood, else false
     */
    eat = (shimejiId) => {
        if (!this.canEat() || this.eatenByShimejiId !== null) return false;
        this.eaten = false;
        this.dom.setAttribute('eaten', 'false');

        this.eatenByShimejiId = shimejiId;

        // stop notification
        clearInterval(this.notifyInterval);
        if (this.stayInWindow) {
            window.removeEventListener('resize', this.handleWindowResize);
            window.removeEventListener('scroll', this.handleScrolling);
        }

        this.dom.remove();

        window.dispatchEvent(
            new CustomEvent('shimejiFoodEaten', { 
                detail: {
                    target: this,
                    id: `shimeji-food-${this.id}`,
                    shimejiId: shimejiId,
                },
            }),
        );
        return true;
    }

    // notify Shimejis to chase after new food is dropped with custom event
    notifyShimeji = () => {
        this.notifyInterval = setInterval(() => {
            if (this.canEat()) {
                window.dispatchEvent(
                    new CustomEvent('shimejiFoodDropped', { 
                        detail: {
                            x: this.position.x + this.width / 2,
                            y: this.position.y + this.height / 2,
                            target: this,
                            id: `shimeji-food-${this.id}`,
                        },
                    }),
                );
            }
        }, TIME_SECOND_IN_MS * 2);
    }

    // deprecated
    fallWithCollision = async () => {
        let visibleElements = getVisibleElements();
        //console.log(visibleElements);
        let initialScrollY = window?.scrollY;
        let [shouldFall, collideElement] = this.shouldFallY(visibleElements);
        //console.log(collideElement);

        while ( shouldFall ) {
            let currY = this.position.y + GRAVITY_PIXEL;
            
            // prioritize dom element to collide, else fall to ground
            if (collideElement) {
                visibleElements = [collideElement]; // reduce time wasted to check irrelevant collision
                let collideRect = collideElement.getBoundingClientRect();
                if ( (currY + this.height) > collideRect.top )
                    currY = collideRect.top - this.height;
                //console.log('collide ', currY);

            } else {
                //console.log('nocollide ', currY);
                visibleElements = [];
            }

            await sleep(FPS_INTERVAL_FALLING);
            
            this.setPosition({
                x: this.position.x,
                y: currY,
            });

            // recompute visible elements when user scrolled the page (does not required active event listener)
            if (window?.scrollY !== initialScrollY) {
                initialScrollY = window?.scrollY;
                visibleElements = getVisibleElements();
            }

            // check if continue falling
            [shouldFall, collideElement] = this.shouldFallY(visibleElements);
        }
        if ( !shouldFall ) {
            this.eaten = true;   // set food to be edible
            this.dom.setAttribute('eaten', 'true');
        }
        return;
    }

    fall = async () => {
        while ( this.shouldFallY() ) {
            await sleep(FPS_INTERVAL_FALLING);
            this.setPosition({
                x: this.position.x,
                y: this.position.y + GRAVITY_PIXEL,
            });
        }
        if ( !this.shouldFallY() ) {
            this.eaten = true;   // set food to be edible
            this.dom.setAttribute('eaten', 'true');
        }
        return;
    }

    // handle window resize
    handleWindowResize = (e) => {
        // update scrollbar width, viewport max width and height
        this.updateScrollbarWidth();

        // update position if necessary
        this.setPosition({
            x: this.position.x,
            y: this.position.y,
        });
        
        this.fall();
    }

    // handle scrolling
    handleScrolling = (e) => {
        window.requestAnimationFrame(() => {
            // update position if necessary
            this.setPosition({
                x: this.position.x,
                y: this.position.y,
            });
            
            this.fall();
        });
    }

    /**
     * @param {number} id
     * @param {{ x: number; y: number; }} position
     * @param {*} options Shimeji food related options
     * @param {boolean} options.stayInWindow will food stay in window when scrolled or resized
     * @returns ShimejiFood instance
     */
    constructor(id, position, options={
        stayInWindow: true,
        interactWithDom: true,
    }) {
        super();
        this.stayInWindow = options.stayInWindow;
        this.id = id;
        this.dom = document.createElement('div');
        this.dom.setAttribute('id', `shimeji-food-${this.id}`);
        this.dom.setAttribute('eaten', 'false');
        this.dom.classList.add('shimeji-food');

        this.setPosition(position);

        document.body.appendChild(this.dom);

        if (this.stayInWindow) {
            window.addEventListener('resize', this.handleWindowResize);
            window.addEventListener('scroll', this.handleScrolling);
        }

        return this;
    }
};


// Shimeji main object
class Shimeji extends BoundedHTMLElement {
    static count = 0;
    id = null;
    dom = null;
    position = {
        x: (window?.innerWidth / 5) * 3,
        y: 10,
    };
    width = WIDTH;
    height = HEIGHT;
    right = 1100 + WIDTH;
    bottom = 10 + HEIGHT;
    // track action type
    #action = ACTIONS.standing;
    // track action animation timeout
    #actionTimeout = null;
    // set if animation is paused (false) or played (true)
    #play = false;
    // track if shimeji is being dragged
    #isDragged = false;
    // track shimeji move direction for walking or climbing actions, see config for list of available options
    #moveDirection = null;
    // set the rotation of the Shimeji which depends on the move direction and attached wall
    #rotation = null;
    // track sequence of actions so that last action animation can be successfully terminated from infinite loop
    #sequence = 0;
    // right click menu
    contextMenu = null;
    // distance to closest food
    closestFoodDistance = null;
    // is chasing food
    isChasingFood = false;
    // id of closest food
    closestFoodId = null;

    // shimeji actions
    actions = [];
    
    // right click menu state
    #menu = {
        position: {
            x: 0,
            y: 0,
        },
        toggled: false,
    };

    /**
     * @param {number} val
     */
    setAction = (val) => {
        this.actions[this.#action].deactivate();
        this.#action = val;
        this.actions[val].activate();
    }
    /**
     * @param {number} val
     */
    setActionTimeout = (val) => {
        if (val===null) {
            this.#actionTimeout = null;
            return;
        }
        this.#actionTimeout = setTimeout(() => {
            //console.log(val);
            this.nextAction();
        }, val);
    }
    /**
     * @param {boolean} val
     */
    setPlay = (val) => {
        this.#play = val;
    }
    /**
     * @param {boolean} val
     */
    setIsDragged = (val) => {
        this.#isDragged = val;
    }
    /**
     * @param {[MOVE_PIXEL_NEG, MOVE_PIXEL_POS]} val
     */
    setMoveDirection = (val) => {
        this.#moveDirection = val;
    }
    /**
     * @param {string} val
     */
    setRotation = (val) => {
        this.#rotation = val;
        this.actions.forEach((action) => {
            action.align(val);
        });
    }
    /**
     * @param {number} val
     */
    setSequence = (val) => {
        this.#sequence = val;
    }

    // handle right click to open menu
    handleRightClick = (e) => {
        e.preventDefault();
        this.setPlay(false);
        // console.log(document.documentElement.clientWidth, document.documentElement.clientHeight);
        // console.log(e.clientX, e.clientY);

        // get reference to context menu bounding rect
        const contextMenuAttr = this.contextMenu.dom.getBoundingClientRect();
        
        // check if cursor is at left of menu when clicked
        const isLeft = e.clientX < this.updateMaxWidth() / 2;

        const isTop = e.clientY > contextMenuAttr.y + contextMenuAttr.height / 2;

        let x = e.clientX;
        let y = e.clientY;

        if (!isLeft) {
            x = e.clientX - contextMenuAttr.width;
        }
        if (isTop) {
            y = e.clientY - contextMenuAttr.height;
        }

        this.contextMenu.setMenu({
            position: {
                x: x,
                y: y,
            },
            toggled: true,
        });

        document.addEventListener('click', this.handleCloseMenu);
    };

    // handle click anywhere on root document to close right click menu
    handleCloseMenu = (e) => {
        // check if right click menu component is shown/visible
        if (this.contextMenu.isVisible()) {
            // check if right click menu component is the one that trigger this function call
            this.contextMenu.setMenu({
                position: {
                    x: 0,
                    y: 0,
                },
                toggled: false,
            });

            this.setPlay(true);
            if (!this.contextMenu.dom.contains(e.target)) {
                // close right click menu
            }
        }
        document.removeEventListener('click', this.handleCloseMenu);
    };

    eatDroppedFood = async (food) => {
        // start eating food animation
        this.setAction(ACTIONS.eatingDroppedFood);
        // align before animation
        this.alignShimeji();
        // stop movement
        this.setMoveDirection(null);

        if( !food.eat() ) {
            // clear food related variables
            this.closestFoodDistance = null;
            this.closestFoodId = null;
            this.isChasingFood = false;
            return;
        }

        let startTime = Date.now();
        let ctr = 0;
        const maxCount = 4;
        while (
            !this.#isDragged &&
            food !== null &&
            this.isChasingFood &&
            ctr < maxCount
        ) {
            if (this.#play && Date.now() - startTime >= FPS_INTERVAL_ACTION) {
                startTime = Date.now();
                this.actions[this.#action].nextFrame();
                ++ctr;
                continue;
            }
            await sleep(FPS_INTERVAL_FALLING);
        }

        // clear food related variables
        this.closestFoodDistance = null;
        this.closestFoodId = null;
        this.isChasingFood = false;
        return;
    }

    // chase food
    toClosestFood = async (e) => {
        const food = e.detail;
        let radius = Math.max(this.width / 2, this.height / 2);
        let x = this.position.x + radius;
        let y = this.position.y + radius;
        x = Math.abs(x - food.x);
        y = Math.abs(y - food.y);
        x = x * x;
        y = y * y;
        let dist = Math.sqrt(x + y);
        if (this.closestFoodDistance !== null && this.closestFoodDistance < dist) {
            return;
        }
        if (this.isChasingFood && this.closestFoodId === food.target.id) // avoid repetition of function invocation
            return;

        // stop current animation
        this.setPlay(false);
        // clear previous timeout
        if (this.#actionTimeout) {
            clearTimeout(this.#actionTimeout);
            this.setActionTimeout(null);
        }


        this.closestFoodDistance = dist;
        this.isChasingFood = true;
        this.closestFoodId = food.target.id;
        
        // take shortcut from sky and wall to ground
        if (this.onXBound()) {
            this.setPosition({
                x: (this.position.x === 0)? MOVE_PIXEL_POS : this.position.x - MOVE_PIXEL_POS,
                y: this.position.y,
            });
            this.fall();
        }
        if (this.onSkyBound()) {
            this.setPosition({
                x: this.position.x,
                y: this.position.y + 1,
            });
            this.fall();
        }

        this.setAction(ACTIONS.walking);
        // move left or right toward food
        this.setMoveDirection( (food.x < this.position.x + radius)? MOVE_PIXEL_NEG : MOVE_PIXEL_POS );
        this.alignShimeji();    // align before movement
        // start animation for shimeji frame component
        this.setPlay(true);
        
        // set new action sequence to terminate last animation
        const currSequence = this.#sequence + 1;
        this.setSequence(currSequence);
        
        //console.log(`shimeji-${this.id} chasing closest ${food.id} at dist = ${dist}`);
        let startTime = Date.now();
        let success = false;
        while (
            !this.#isDragged &&
            document.getElementById(food.id) !== null &&
            this.isChasingFood &&
            this.closestFoodId === food.target.id &&
            food.target.canEat()
        ) {
            if (this.#play && Date.now() - startTime >= FPS_INTERVAL_CHASING_FOOD) {
                startTime = Date.now();
                this.actions[this.#action].nextFrame();
                this.closestFoodDistance = Math.abs(this.position.x + radius - food.x);
                if ( this.closestFoodDistance < MOVE_PIXEL_POS) {
                    success = true;
                    break;
                }
                if ( this.position.x + this.#moveDirection <= 0 || this.right + this.#moveDirection >= this.updateMaxWidth() ) {
                    success = true;
                    this.setPosition({
                        x: this.position.x + this.#moveDirection,
                        y: this.position.y,
                    });
                    break;
                }
                this.moveShimeji();
                this.alignShimeji();// align after movement
                continue;
            }
            await sleep(FPS_INTERVAL_FALLING);
        }
        
        if (this.closestFoodId === food.target.id && food.target.canEat() && !this.#isDragged && success) {
            await this.eatDroppedFood(food.target);
        }
        if (!this.isChasingFood || !success) {
            this.isChasingFood = false;
            this.closestFoodDistance = null;
            this.closestFoodId = null;
            await this.nextAction(ACTIONS.standing);
        }
        return;
    }

    // remove current Shimeji from document
    removeShimeji = () => {
        window.removeEventListener('resize', this.handleWindowResize);
        window.removeEventListener('scroll', this.handleScrolling);
        this.dom.addEventListener('shimejiFoodDropped', this.toClosestFood);
        let clone = this.dom.cloneNode(true);
        // remove all event listener on shimeji and child components
        this.dom.parentNode.replaceChild(clone, this.dom);
        // this.contextMenu.remove();   // not required as menu is removed when clicked on the remove shimeji button
        this.actions.forEach((action) => {
            action.remove();
        });
        document.getElementById(this.dom.getAttribute('id')).remove();
    }

    // invoke parent's function for duplicating a shimeji
    duplicateShimeji = () => {
        this.setPlay(true);
        if (!this.duplicable) return null;
        return new Shimeji();
    }

    // align Shimeji to appropriate rotation to face the direction it is currently moving to
    alignShimeji = () => {
        switch (this.#action) {
            case ACTIONS.walking: {
                if (this.position.y === 0) {
                    if (this.#moveDirection > 0) {
                        this.setRotation('scale(-1, -1)');
                        return;
                    }
                    this.setRotation('scaleY(-1)');
                    return;
                }
                if (this.position.y > 0 && this.#moveDirection > 0) {
                    this.setRotation('scaleX(-1)');
                    return;
                }
                this.setRotation('none');
                return;
            }
            case ACTIONS.climbing: {
                if (this.right >= this.updateMaxWidth()) {
                    if (this.#moveDirection > 0) {
                        this.setRotation('scale(-1, -1)');
                        return;
                    }
                    this.setRotation('scaleX(-1)');
                    return;
                }
                if (this.position.x === 0 && this.#moveDirection > 0) {
                    this.setRotation('scaleY(-1)');
                    return;
                }
                this.setRotation('none');
                return;
            }
            default: {
                // no other action is permitted when not on the ground except climbing & walking
                this.setRotation('none');
                return;
            }
        }
    }

    // move Shimeji in up down left right direction by fixed number of pixel
    moveShimeji = () => {
        if (!this.#play || this.#isDragged) {
            //console.log('cancelled...');
            return;
        }
        //console.log('animate... ', actionRef.current);
        let newPosition = this.#moveDirection;
        
        if(this.#action === ACTIONS.walking) {
            this.updateMaxWidth();
            newPosition += this.position.x;
            // if not hitting wall
            if (newPosition > 0 && newPosition + WIDTH < this.maxWidth) {
                //console.log('moving... ', this.position.x, ' -> ', newPosition);
                this.setPosition({
                    x: newPosition,
                    y: this.position.y,
                });
                return;
            }
            //console.log('hit wall... ', newPosition);
            
            // if 0 = hit left wall else right wall
            this.setPosition({
                x: newPosition,
                y: this.position.y,
            });
            
            // change action to climbing
            this.setAction(ACTIONS.climbing);

            // move downward if in the sky, else move upward if on the ground
            this.setMoveDirection((this.position.y === 0)? MOVE_PIXEL_POS : MOVE_PIXEL_NEG);
            return;
        } else if (this.#action === ACTIONS.climbing) {
            this.updateMaxHeight();
            //console.log('climbing... ');
            newPosition += this.position.y;
            // if not hitting ground or sky
            if (newPosition > 0 && newPosition + HEIGHT < this.maxHeight) {
                //console.log('moving... ', this.position.x, ' -> ', newPosition);
                this.setPosition({
                    x: this.position.x,
                    y: newPosition,
                });
                return;
            }
            
            // if 0 = hit sky else ground
            //console.log('hit sky/gnd... ', newPosition);
            this.setPosition({
                x: this.position.x,
                y: newPosition,
            });
            
            // change action to walking
            this.setAction(ACTIONS.walking);
            
            // move rightward if on left wall, else move leftward if on right wall
            this.setMoveDirection((this.position.x === 0)? MOVE_PIXEL_POS : MOVE_PIXEL_NEG);
            return;
        }
    }

    nextAction = async (actionId = null) => {
        const newTimeout = generateTimeOutDuration();
        // clear previous timeout
        clearTimeout(this.#actionTimeout);
        
        // stop current animation
        this.setPlay(false);
        
        // set new duration for next action
        this.setActionTimeout(newTimeout);
        
        // set action animation
        let currAction = (actionId)? actionId : generateActionID(this.#action);
        this.updateMaxHeight();
        if (this.bottom < this.maxHeight) {
            if (this.onXBound()) {
                currAction = ACTIONS.climbing;
            } else {
                currAction = ACTIONS.walking;
            }
        }
        if (this.#action !== currAction) {
            this.setAction(currAction);
        }

        // start animation for shimeji frame component
        this.setPlay(true);
        
        // set new action sequence to terminate last animation
        const currSequence = this.#sequence + 1;
        this.setSequence(currSequence);
        
        // if walking or climbing, set move direction
        if (currAction === ACTIONS.walking || currAction === ACTIONS.climbing) {
            this.setMoveDirection(generateMoveDirection(this.#moveDirection));
        } else {
            this.setMoveDirection(null);
        }
        let startTime = Date.now();
        while (
            !this.#isDragged &&
            this.#sequence === currSequence &&
            !this.isChasingFood
        ) {

            if (this.#play && Date.now() - startTime >= FPS_INTERVAL_ACTION) {
                startTime = Date.now();
                this.alignShimeji();    // align before movement
                if (this.animate)
                    this.actions[this.#action].nextFrame();
                
                if (this.#moveDirection !== null && this.move) {
                    this.moveShimeji();
                    this.alignShimeji();// align after movement
                }
                continue;
            }
            await sleep(FPS_INTERVAL_FALLING);
        }
        return;
    }

    land = async () => {
        await sleep(FPS_INTERVAL_FALLING * 2);
        this.setAction(ACTIONS.landing);
        await sleep(FPS_INTERVAL_FALLING * 5);
    }

    fall = async () => {
        this.setPlay(false);
        this.setAction(ACTIONS.falling);
        while (this.shouldFall() && !this.#isDragged) {
            await sleep(FPS_INTERVAL_FALLING);
            this.setPosition({
                x: this.position.x,
                y: this.position.y + GRAVITY_PIXEL,
            });
        }
        if (!this.shouldFall()) {
            if ( !this.onXBound() || !this.onSkyBound() )
                await this.land();

            if ( this.onXBound() )
                this.setAction(ACTIONS.climbing);

            if ( this.onYBound() )
                this.setAction(ACTIONS.walking);

            this.alignShimeji();
            
            if (!this.#play)
                this.setPlay(false);

            if (!this.isChasingFood)
                await this.nextAction();
        }
    }

    // handle window resize
    handleWindowResize = (e) => {
        // update scrollbar width, viewport max width and height
        this.updateScrollbarWidth();

        // update position if necessary
        this.setPosition({
            x: this.position.x,
            y: this.position.y,
        });
        
        // fall if above ground and below sky
        this.fall();
    }

    // handle scrolling
    handleScrolling = (e) => {
        window.requestAnimationFrame(() => {
            // update position if necessary
            this.setPosition({
                x: this.position.x,
                y: this.position.y,
            });
            // this.fall();
        });
    }

    // handle dragging shimeji event
    handleDrag = (e) => {
        e.preventDefault();
        
        this.setPosition({
            x: e.x,
            y: e.y - 50,
        });
    }

    handleDragEnd = (e) => {
        window.removeEventListener('mousemove', this.handleDrag);
        this.setIsDragged(false);
        this.fall();
        window.removeEventListener('mouseup', this.handleDragEnd);
    }

    // handle drag start shimeji event
    handleDragStart = (e) => {
        if (e.button===2) {
            return;
        }
        e.stopPropagation();
        if (this.#play && !this.#isDragged && e.button===0) {
            this.setPlay(false);
            if (this.#actionTimeout) {
                clearTimeout(this.#actionTimeout);
                this.setActionTimeout(null);
            }
            this.setRotation('none');
            this.setIsDragged(true);
            this.setAction(ACTIONS.dragging);
            
            window.addEventListener('mousemove', this.handleDrag);
            window.addEventListener('mouseup', this.handleDragEnd);
        }
        return;
    };

    /**
     * Spawn a new Shimeji with customization option
     * @param {boolean} options.animate enable or disable action animation
     * @param {boolean} options.draggable is shimeji draggable
     * @param {boolean} options.move will shimeji walk or climb
     * @param {boolean} options.chaseFood will shimeji chase after nearest food
     * @param {boolean} options.duplicable is shimeji duplicable
     * @param {boolean} options.stayInWindow will shimeji stay in window when scrolled or resized
     * @param {boolean} options.showMenu enable or disable right click menu of shimeji
     * @returns Shimeji instance
     */
    constructor(options={
        animate: true,
        draggable: true,
        move: true,
        chaseFood: true,
        duplicable: true,
        stayInWindow: true,
        showMenu: true,
    }) {
        super();
        this.animate = options.animate;
        this.draggable = options.draggable;
        this.move = options.move;
        this.chaseFood = options.chaseFood;
        this.duplicable = options.duplicable;
        this.stayInWindow = options.stayInWindow;
        this.showMenu = options.showMenu;
        this.spawnShimeji();
        this.fall();
        return this;
    }

    spawnShimeji = () => {
        Shimeji.count++;
        this.id = Shimeji.count;
        this.dom = document.createElement('div');
        const eleId = 'shimeji-' + this.id;
        this.dom.setAttribute('id', eleId);
        this.dom.classList.add('shimeji-container');
        this.dom.style.width = `${WIDTH}px`;
        this.dom.style.height = `${HEIGHT}px`;
        // this.dom.style.top = `${this.position.y}px`;
        // this.dom.style.left = `${this.position.x}px`;
        this.dom.style.transform = `translate(${this.position.x}px, ${this.position.y}px)`;

        this.contextMenu = new ContextMenu(this.id, this.removeShimeji, this.duplicateShimeji);
        this.dom.appendChild(this.contextMenu.dom);

        this.actions = Array(Object.keys(ACTIONS).length).fill(null);
        Object.keys(ACTIONS).forEach((actionName, index) => {
            this.actions[index] = new ShimejiFrame(this.id, ACTIONS[actionName]);
            this.dom.appendChild(this.actions[index].dom);
        });


        // apply settings and append Shimeji to document
        document.body.appendChild(this.dom);

        // drag event handler
        if (this.draggable) {
            this.dom.onmousedown = this.handleDragStart;
        }
        
        if (this.showMenu) {
            this.dom.oncontextmenu = this.handleRightClick;
        }

        if (this.stayInWindow) {
            window.addEventListener('resize', this.handleWindowResize);
            window.addEventListener('scroll', this.handleScrolling);
        }

        if (this.chaseFood) {
            window.addEventListener('shimejiFoodDropped', this.toClosestFood);
        }
    }
};

// Shimeji controller class to supply default setting options and control behavior of Shimeji and ShimejiFood
class ShimejiController {
    // food
    shimejiFoods = Array(MAX_FOOD_COUNT).fill(undefined);
    // mouse pointer position
    #mousePosition = {
        x: 0,
        y: 0,
    };
    // spawn interval
    #spawnInterval = null;

    // generate unique id for new shimeji food to ensure no duplicate id
    getValidFoodID = () => {
        let i = 0;
        while (i < this.shimejiFoods.length) {
            if (typeof this.shimejiFoods[i] === "undefined") {
                return i;
            }
            ++i;
        }
        return null;
    }

    recordMousePosition = (e) => {
        this.#mousePosition.x = e.clientX;
        this.#mousePosition.y = e.clientY;
    }

    dropFood = async (e) => {
        if (e.code !== 'KeyF')
            return;
        
        let pos = {
            x: this.#mousePosition.x,
            y: this.#mousePosition.y,
        };
        
        let validId = this.getValidFoodID();
        if (validId !== null && document.querySelectorAll('.shimeji-container').length > 0) {
            this.shimejiFoods[validId] = new ShimejiFood(validId, pos, this.foodOptions);
            await this.shimejiFoods[validId].fall();
            this.shimejiFoods[validId].notifyShimeji();
        }
    }

    removeEatenFood = (e) => {
        const id = e.detail.target.id;
        this.shimejiFoods[id] = undefined;
    }

    /**
     * Spawn a new Shimeji with customization option
     * @param {*} shimejiOptions Shimeji related options
     * @param {boolean} shimejiOptions.animate enable or disable action animation
     * @param {boolean} shimejiOptions.draggable is shimeji draggable
     * @param {boolean} shimejiOptions.move will shimeji walk or climb
     * @param {boolean} shimejiOptions.chaseFood will shimeji chase after nearest food
     * @param {boolean} shimejiOptions.duplicable is shimeji duplicable
     * @param {boolean} shimejiOptions.stayInWindow will shimeji stay in window when scrolled or resized
     * @param {boolean} shimejiOptions.showMenu enable or disable right click menu of shimeji
     * @param {*} foodOptions Shimeji food related options
     * @param {boolean} foodOptions.dropFood enable or disable food dropping
     * @param {boolean} foodOptions.stayInWindow will food stay in window when scrolled or resized
     * @param {boolean} options.autoSpawnShimeji enable or disable automated spawn of new Shimeji instance at an interval in second
     * @param {boolean} options.spawnInteral set the default interval in second to spawn new Shimeji instance automatically
     */
    constructor (options={
        shimejiOptions: {
            animate: true,
            draggable: true,
            move: true,
            chaseFood: true,
            duplicable: true,
            stayInWindow: true,
            showMenu: true,
        },
        foodOptions: {
            dropFood: true,
            stayInWindow: true,
        },
        autoSpawnShimeji: false,
        spawnInteral: 20,
    }) {
        this.shimejiOptions = options.shimejiOptions;
        this.foodOptions = options.foodOptions;
        if (this.foodOptions.dropFood) {
            window.addEventListener('mousemove', this.recordMousePosition);
            window.addEventListener('keyup', this.dropFood);
            window.addEventListener('shimejiFoodEaten', this.removeEatenFood);
        }
        new Shimeji(this.shimejiOptions);

        if (options.autoSpawnShimeji) {
            this.#spawnInterval = setInterval(() => {
                new Shimeji(this.shimejiOptions);
            }, options.spawnInteral * TIME_SECOND_IN_MS);
        }
        return this;
    }

    remove = () => {
        if (this.foodOptions.dropFood) {
            window.removeEventListener('mousemove', this.recordMousePosition);
            window.removeEventListener('keyup', this.dropFood);
            window.removeEventListener('shimejiFoodEaten', this.removeEatenFood);
        }
        if (options.autoSpawnShimeji) {
            clearInterval(this.#spawnInterval);
        }
        document.querySelectorAll('.shimeji-container').forEach(e => e.remove());
    }
};
